function BattleMonsterConfig.GetConfig(key)
	local tb = BattleMonsterConfig.Values[key]
	if not tb then
		print_error(key)
		return nil
	end
	local config = {["id"] = 1,["typename"] = 2,["fettermonster"] = 3,["typeship"] = 4,["country"] = 5,["fetterstype"] = 6,["priority"] = 7,["normalskill"] = 8,["atkskill"] = 9,["activeskill"] = 10,["skincfg"] = 11,["battlecfg"] = 12,["monsterintro"] = 13,["nazo"] = 14,}
	for k,v in pairs(config) do
		config[k] = tb[v]
	end
	return config 
end
return BattleMonsterConfig